import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {Navbar} from './src/Navbar'
import {projectImage} from './src/Image'



export default function App() {
  const [images, setImages] = React.useState([])

     fetch('https://api.unsplash.com/photos/?client_id=ab3411e4ac868c2646c0ed488dfd919ef612b04c264f3374c97fff98ed253dc9')
        .then(res => res.json())
        .then(json => setImages(json))
        .catch(err => console.log('Error: ', err))
console.log(images[0].id)
  const imgs = images.map(img => {
    <projectImage source={img.urls.regular} id={img.id}/>
  })


  return (
    <View style={styles.container}>
      <Navbar title={'Image App'}/>
      {imgs}
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
